import './App.css';
import signIn from "./components/login/signIn";
import signUp from "./components/login/signUp";


function App() {
  return (
    <div className="App">
      <header>
        <nav>
          <ul>
            <ul><li>Music App</li></ul>
            <ul>
            <li>Home</li>
            <li>About</li>
            <li>Sign up</li>
            <li>Sign sin</li>
            </ul>
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default App;
